import React from "react";


import "./footer.css";
import { Container, Row, Col, ListGoupItem }  from "reactstrap";
import { Link } from "react-router-dom";

import logo from "../../assets/images/logo.png";

const nav__links = [
    {
        path: "/home",
        display: "Home",

    },
    {
        path: "/ab",
        display: "Home",

    },
    {
        path: "/home",
        display: "Home",

    },
]

const Footer = () => {
    return (
        <footer className="footer">
            <Container>
                <Row>
                    <Col lg="3">

                    </Col>
                </Row>
            </Container>
        </footer>
    );

};
export default Footer;
